import Menu from '../assets/images/menu.svg';
import React, { useState } from "react";
import cn from "classnames";
import Left from '../assets/images/angles-left-solid.svg';

export default function NavBar() {
    const [open, setOpen] = useState(false);

    return (
        <div className={cn('fixed top-0 left-0  h-full bg-white flex flex-col py-8 z-[9999] transition-all duration-800 ease-in-out', {'w-[120px]': !open, 'w-[300px]': open})}>
            <div className='flex_center'>
                <button className={cn('w-[60px] h-[60px] flex_center')} onClick={(event : React.MouseEvent<HTMLButtonElement>) => setOpen(!open)}>
                    {open ?
                        <img src={Left} alt={'Left'} width={40}/>
                        :
                        <img src={Menu} alt={'menu'} width={40}/>
                    }
                </button>
            </div>
            <div className='flex_center flex-col mt-32'>
                <div className='mb-8'>
                    마이체크업
                </div>
                <div>
                    벨류맵
                </div>
            </div>
        </div>
    )
}
